import { useEffect } from 'react'
import { useDispatch , useSelector } from 'ract-redux';
import { getPosts } from '../store/actions/postsAction';

export const Home = () => {
    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(getPosts());
    })
    return (
        <div>
            Home
        </div>
    )
}

export default Home
